import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { createSkill } from '../../../../../services/SkillService'; // Ensure this path is correct
import './AddSkill.css';

const AddSkill = () => {
  const [skillName, setSkillName] = useState('');
  const [skillDescription, setSkillDescription] = useState('');
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  console.log('Rendering AddSkill component'); // Add logging

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);

    const newSkill = {
      name: skillName,
      description: skillDescription,
    };

    try {
      const data = await createSkill(newSkill);
      console.log(data);
      alert('Skill created successfully');
      navigate('/admin');
    } catch (err) {
      console.error('Error creating skill:', err);
      if (err.response && err.response.data) {
        setError(err.response.data.message || 'Error creating skill. Please try again.');
      } else if (err.request) {
        setError('Network error. Please check your connection and try again.');
      } else {
        setError('An unexpected error occurred. Please try again.');
      }
    }
  };

  const handleGoBack = () => {
    navigate('/admin');
  };

  return (
    <div className="container-fluid">
      <div className="row mt-3 text-center">
        <div className="col-3"></div>
        <div className="col-6">
          <div className="card border-5 shadow bg-gradient bg-light">
            <h5 className="card-title mt-3">Add a new Skill</h5>
            <div className="card-body">
              {error && <div className="alert alert-danger">{error}</div>}
              <form className="form" onSubmit={handleSubmit}>
                <div className="form-group">
                  <div className="input-group">
                    <span className="input-group-text">Name</span>
                    <input
                      className="form-control"
                      type="text"
                      placeholder="Skill Name"
                      value={skillName}
                      onChange={(e) => setSkillName(e.target.value)}
                      required
                    />
                  </div>
                  <div className="input-group mt-1">
                    <span className="input-group-text">Description</span>
                    <input
                      className="form-control"
                      type="text"
                      placeholder="Skill Description"
                      value={skillDescription}
                      onChange={(e) => setSkillDescription(e.target.value)}
                      required
                    />
                  </div>
                  <div className="row mt-3 text-center">
                    <div className="col-5"></div>
                    <div className="col-2">
                      <div className="input-group">
                        <button className="btn btn-outline-success" type="submit">
                          Create Skill
                        </button>
                      </div>
                    </div>
                    <div className="col-5"></div>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
        <div className="col-3"></div>
      </div>
      <div className="row text-center mt-5">
        <div className="col-4"></div>
        <div className="col-4">
          <button className="btn btn-outline-danger" onClick={handleGoBack}>
            Go Back
          </button>
        </div>
        <div className="col-4"></div>
      </div>
    </div>
  );
};

export default AddSkill;
